import React from "react";

function UserDetails({
  name,
  handleName,
  password,
  handlePassword,
  email,
  handleEmail,
}) {
  return (
    <div className="pageWrapper">
      <label>Email:</label>
      <input
        type="email"
        name="email"
        value={email}
        onChange={handleEmail}
        required
      />

      <label>Password:</label>
      <input
        type="password"
        name="password"
        value={password}
        onChange={handlePassword}
        required
      />

      <label>Name:</label>
      <input
        type="text"
        name="name"
        value={name}
        onChange={handleName}
        required
      />
    </div>
  );
}

export default UserDetails;
